var title_f23_2_23588="Etiology renal agenesis";
var content_f23_2_23588=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F80784&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F80784&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Diagram of normal and abnormal kidney development",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 404px; height: 396px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Uppermost are the precursor structures of a single renal tract, as would be present in a human fetus of 4-5 weeks' gestation; note the mesonephric duct, metanephric mesenchyme (which will form nephrons), and ureteric bud. Solid arrows indicate normal developmental pathways and dotted arrows indicate abnormal pathways. In normal development, the ureteric bud grows into the metanephric mesenchyme and is followed by bud branching and nephron induction and, finally, development of a fully functional, normal kidney containing multiple layers of nephrons. Hypoplastic kidneys contain fewer layers of nephrons than normal but retain a moderated degree of excretory function. Cystic dysplastic kidneys contain malformed tubules and some small cysts but generally retain some excretory function. A discrete renal pelvis (white) is present in normal, hypoplastic and cystic dysplastic kidneys; this feature would appear distended (hydronephrotic) if the kidney was attached to an obstructed lower tract (not shown). The multicystic dysplastic kidney has no useful excretory function and its pelvis is absent or severely disorganized. Aplastic kidneys undergo no primary growth or development; a similar phenotype is seen in the organ remnant left after the spontaneous involution of a multicystic dysplastic kidney. In the most profound type of malformation, agenesis, the first steps of kidney development do not occur and the kidney (and often the ureter) is absent.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted by permission from MacMillan Publishers Ltd. Kerecuk, L, Schreuder, MF, Woolf, AS. Renal tract malformations: perspectives for nephrologists. Nat Clin Pract Nephrol 2008; 4:312. Copyright &copy;2008.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
