var title_f23_2_23598="Mortality with syncope by cause";
var content_f23_2_23598=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F53302&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F53302&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 483px\">",
"   <div class=\"ttl\">",
"    Overall survival of patients with syncope",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 463px; height: 324px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Survival was worst for patients with a cardiovascular cause of syncope. P &lt;0.001 for the comparison between participants with and those without syncope. The category \"Vasovagal and other causes\" includes vasovagal, orthostatic, medication-induced, and other, infrequent cause of syncope.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Sorteriades ES, Evans JC, Larson MG, et al. Incidence and prognosis of syncope. N Engl J Med 2002; 347:878.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
