" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Immunofluorescence microscopy showing mesangial IgA deposits",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 394px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Immunofluorescence microscopy demonstrating large, globular mesangial IgA deposits that are diagnostic of IgA nephropathy or Henoch-Sch&ouml;nlein purpura (IgA vasculitis). Note that the capillary walls are not outlined since the deposits are primarily limited to the mesangium.",
